css:
@-moz-document domain("bing.com"), domain("google.com"), domain("baidu.com"), domain("sogou.com") {


/* Microsoft Bing Search Result */
.b_logo:after{
    content: None;
}

/* Google Search Result */
.logo #logo img{
    visibility: hidden;
}

/* Baidu Search Result */
#result_logo img{
    visibility: hidden;
}

/* Sogou Search Result */
.header .header-box .logo img{
    visibility: hidden;
}
}
